-- ======================================> BEGIN SECTION <=====================================
-- CREATE COLOUR TABLE(S)
-- This section creates the 'colours' table, one of the most commonly created database table
-- structures. The basic user table will vary depending on the developer's choices.
-- For example, the user's address information may be moved into a second table that contains
-- data associated with their profile.
-- --------------------------------------------------------------------------------------------

-- --------------------------------------------------------------------------------------------
-- Tell MySQL to use the XXX_SaaS_FED_YYYY_SN database for commands.
-- --------------------------------------------------------------------------------------------
USE `XXX_SaaS_FED_YYYY_SN`;

-- --------------------------------------------------------------------------------------------
-- Remove any existing colours table
-- --------------------------------------------------------------------------------------------
DROP TABLE IF EXISTS `XXX_SaaS_FED_YYYY_SN`.`colours`;

-- --------------------------------------------------------------------------------------------
-- Create the table structure for the 'colours' table
-- --------------------------------------------------------------------------------------------
CREATE TABLE IF NOT EXISTS `XXX_SaaS_FED_YYYY_SN`.`colours`
(
    `id`             int          NOT NULL AUTO_INCREMENT,
    `name`           varchar(128) NOT NULL,
    `hex_code`       varchar(8)   DEFAULT NULL,
    `red`            smallint     UNSIGNED DEFAULT 00,
    `green`          smallint     UNSIGNED DEFAULT 00,
    `blue`           smallint     UNSIGNED DEFAULT 00,
    `oklch`          varchar(32)  DEFAULT NULL,
    `l`              float        DEFAULT NULL,
    `c`              float        DEFAULT NULL,
    `h`              float        DEFAULT NULL,
    `classification` VARCHAR(32)  DEFAULT NULL,
    `created_at`     timestamp    DEFAULT CURRENT_TIMESTAMP,

    PRIMARY KEY (`id`)

) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci;
-- =======================================> END SECTION <======================================


-- --------------------------------------------------------------------------------------------
-- Remove any existing colour_product pivot table
-- --------------------------------------------------------------------------------------------
DROP TABLE IF EXISTS `XXX_SaaS_FED_YYYY_SN`.`colour_product`;

-- --------------------------------------------------------------------------------------------
-- Create the table structure for the 'colours' table
-- --------------------------------------------------------------------------------------------
CREATE TABLE IF NOT EXISTS `XXX_SaaS_FED_YYYY_SN`.`colour_product`
(
    `id`         int NOT NULL AUTO_INCREMENT,
    `colour_id`  int NOT NULL,
    `product_id` int NOT NULL,
    `created_at` timestamp DEFAULT CURRENT_TIMESTAMP,

    PRIMARY KEY (`id`),
    UNIQUE KEY (`product_id`, `colour_id`)

) ENGINE = InnoDB
  AUTO_INCREMENT = 0
  DEFAULT CHARSET = utf8mb4
  COLLATE = utf8mb4_general_ci;
-- =======================================> END SECTION <======================================


